def morganAndString(a, b):
    # Write your code here
    a, b = [*a], [*b]
    i, j = 0, 0
    result = []
    while (i < len(a)) & (j < len(b)):
        # print('i,j : ',i,j)
        if a[i] < b[j]:
            result.append(a[i])
            i += 1
        elif a[i] > b[j]:
            result.append(b[j])
            j += 1
        else:
            m, n = i, j
            while (m < len(a)) & (n < len(b)):
                # print('m,n : ',m,n)
                if (a[m] != b[n]):
                    break
                elif (a[m] == b[n]) & (a[m] > a[i]):
                    result.extend(a[i:m])
                    result.extend(b[j:n])
                    i = m
                    j = n
                m += 1
                n += 1

            if m == len(a):
                result.append(b[j])
                j = j + 1
            elif n == len(b):
                result.append(a[i])
                i = i + 1
            else:
                if a[m] < b[n]:
                    result.append(a[i])
                    i = i + 1
                else:
                    result.extend(b[j])
                    j = j + 1

    # print(result)
    if i < len(a):
        result.extend(a[i:])
    if j < len(b):
        result.extend(b[j:])
    # print(result)
    return ''.join(result)

